import One from "./web"
import Login from "./login";
import Main from "/logout.js"

import { BrowserRouter as Router, Routes ,Route } from "react-router-dom";

function Run(){
    return(
        <div>
            <Router>
                <Routes>
                    <Route path="/" element={<One/>}/>
                    <Route path="/login" element={<Login/>}/>
                    <Route path="/logout" element={<Main/>}/>
                </Routes>
            </Router>
        </div>

    )
}
export default Run;
